import React from "react";
import Price from "../Price/Price";
import styles from "../Card/Card.module.css";

function Card(card) {

    return (
        <li>
            <img className={styles.image} src={card.image} alt={card.name}/>
            <Price>{card.price}</Price>
            <p>{card.name}</p>
        </li>
    )
}

export default Card;
